import React from 'react';

function BookReview({user, book}){
    return(
        <div>
            <div>
            {book.title}
            </div>
            <div>
            {book.author}
            </div>
            <div>
            {book.publisher}
            </div>
            <div>
            {book.genre}
            </div>
            <br/>
            <br/>
            Reviews:
        </div>
    )
}

export default BookReview;
